import React from 'react';
import styled from 'styled-components';
import { BlotterText } from './BlotterText';

const TokenomicsSection = styled.section`
  min-height: 100vh;
  padding: 4rem 2rem;
  background: linear-gradient(180deg, #000000 0%, #1a1a1a 100%);
`;

const Content = styled.div`
  max-width: 1200px;
  margin: 0 auto;
`;

const Grid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 2rem;
  margin-top: 4rem;
`;

const Card = styled.div`
  background: rgba(255, 255, 255, 0.05);
  border-radius: 20px;
  padding: 2rem;
  backdrop-filter: blur(10px);
  transition: transform 0.3s ease;

  &:hover {
    transform: translateY(-5px);
  }
`;

const CardTitle = styled.h3`
  font-size: 1.5rem;
  color: #ffffff;
  margin-bottom: 1rem;
  font-family: 'Comic Sans MS', cursive;
`;

const CardText = styled.p`
  font-size: 1.1rem;
  color: #f0f0f0;
  line-height: 1.6;
  font-family: 'Comic Sans MS', cursive;
`;

export const Tokenomics: React.FC = () => {
  return (
    <TokenomicsSection>
      <Content>
        <BlotterText 
          text="TOKENOMICS" 
          size={60}
          fill="#ffffff"
        />
        <Grid>
          <Card>
            <CardTitle>Governance</CardTitle>
            <CardText>
              Squanch your way into decision-making! Every holder gets voting power proportional to their holdings. The more you squanch, the more say you have in the future of our ecosystem!
            </CardText>
          </Card>
          <Card>
            <CardTitle>Staking</CardTitle>
            <CardText>
              Lock up your Squanch and earn rewards! Our staking system is so squanchy, it'll make your portfolio grow faster than Rick's garden of mega trees!
            </CardText>
          </Card>
          <Card>
            <CardTitle>Community</CardTitle>
            <CardText>
              Join the squanchiest community in crypto! We're not just hodlers, we're family! Participate in community events, earn rewards, and help shape the future of SquanchCoin!
            </CardText>
          </Card>
        </Grid>
      </Content>
    </TokenomicsSection>
  );
};
